window.bookSummaryJSON = "<p><b>Can a simple human tame a Cheetah’s wild heart? </b> </p> <p>When I arrive in the Cheetah Nation with my two lovers, my sister, and our enigmatic guard, nothing goes as planned. After being hospitalized for a human illness, I wake to find myself a prisoner to famous billionaire cheetah, Sir Kenosi. Any woman in the world would be overjoyed at the opportunity to slide between the insatiable entrepreneur’s sheets, but he’s not interested in Kitty Chasers. He wants me. </p> <p>You might think I’d be flattered, but the truth is more complicated. Sir Kenosi doesn’t just want to bed me. He wants to break me. To make me beg and grovel like he’s royalty and I’m a peasant. </p> <p>That’s not really my style. </p> <p>Or is it? After all, my pride is a small price to pay for an amulet that brings my sister closer to the throne and me closer to being reunited with my team. </p> <p>As I come to know the real Sir Kenosi, the one behind the rock-star grin and twisted bedroom games, something inside me learns to crave his touch and the humiliation it brings. But there's one thing I need more. The amulets. </p> <p>And though Sir Kenosi might have taught me submission, nothing can prepare me for what I learn next. </p> <p><i>Feline Royals series is a 18+ Reverse Harem/Why Choose Dark Romance filled with passion and intrigue. Triggers and taboo increase as the series progresses. </i> </p> <p>*This book was previously published under the title <i>Marking Her Mates. </i>This new edition contains SEVEN new chapters from Itzel's men, including one massive cliffhanger. Please heed the warning before listening to the epilogue. </p> <p>Perfect for listeners who love: </p> <ul> <li>captivity, kidnap, and Stockholm syndrome themes </li> <li>reverse harem with love interests added along the way </li> <li>badass princesses with big hearts </li> <li>a plot full of twists and turns, quests, and political intrigue </li> <li>panty-melting steamy scenes </li> <li>scheming royals, betrayals, and sibling loyalty </li> <li>sexy big cat shifters </li> <li>fated mates and mating frenzy</li> </ul>"; 
